import Login from './Compoment/Login_Registor/Login';
import Home from './Compoment/Home/Home';
import ApiDocument from './Compoment/Api'
import { Navbar, Image, Row, Col, Card } from 'react-bootstrap'
import React from 'react'
import './asset/css/bootstrap.min.css';
import './App.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
function App() {
  return (
    <Router>
      <Switch>
        <Route exact={true} path="/login" render={() => <Login status_login={false}></Login>}></Route>
        <Route exact={true} path="/register" render={() => <Login status_login={true}></Login>}></Route>
      </Switch>
      <Switch>

        <Navbar>

        </Navbar>

        <Row>
          <Col>
            <Image fluid src='https://images.viblo.asia/full/5ce3a357-fe69-4a26-8b31-be94aabbf254.png' rounded />
          </Col>
        </Row>
        <Row>
          <Route exact path="/" render={() => (<Home></Home>)}></Route>
        </Row>
        <Route exact path="/document" component={ApiDocument}></Route>
      </Switch>
    </Router>
  );
}


export default App;
